import process01 from '../../public/process01.png';
import process02 from '../../public/process02.png';
import process03 from '../../public/process03.png';
import photo3 from '../../public/3.jpeg';
import photo4 from '../../public/4.jpeg';
import dynamic from 'next/dynamic';
const Carousel = dynamic(
    () => import('react-customize-carousel').then(mod => mod.Editor),
    { ssr: false }
)

const Test = () => {
    return(
        <React.Fragment>
            <div>Carousel</div>
            <Carousel
                imgsrc={[process01, process02, process03]}
                rotateBy={3}
                width={'800px'}
                height={'500px'}
                navigateButton={true}
                controlButton={true}
            />
            <div>Carousel</div>
        </React.Fragment>
    )
}

export default Test;
